function animate(){
    requestAnimationFrame(() => { animate() } );

    if ( iLoaded&&gLoaded ) {

        const time = Date.now() * 0.001;
        //wingMesh.rotation.x = Math.sin( time / 4 );
        //wingMesh.rotation.y = Math.sin( time / 2 );

        for ( let i = 0; i < butterflyCount; i += 1 ) {

            let vel_limit = base_vel_limit - (i * (base_vel_limit/(butterflyCount*2)));

            positions[i].x += velocities[i].x;
            positions[i].y += velocities[i].y;
            positions[i].z += velocities[i].z;
            
                if (positions[i].x < positions[targets[i]].x) {velocities[i].x += accel}
                if (positions[i].x > positions[targets[i]].x) {velocities[i].x -= accel}
                if (positions[i].y < positions[targets[i]].y) {velocities[i].y += accel}
                if (positions[i].y > positions[targets[i]].y) {velocities[i].y -= accel}
                if (positions[i].z < positions[targets[i]].z) {velocities[i].z += accel}
                if (positions[i].z > positions[targets[i]].z) {velocities[i].z -= accel}

            velocities[i].x += (Math.random()*0.004) - 0.002;
            velocities[i].y += (Math.random()*0.004) - 0.002;
            velocities[i].z += (Math.random()*0.004) - 0.002;

            if(velocities[i].x>vel_limit){velocities[i].x = vel_limit};
            if(velocities[i].x<-vel_limit){velocities[i].x = -vel_limit}
            if(velocities[i].y>vel_limit){velocities[i].y = vel_limit};
            if(velocities[i].y<-vel_limit){velocities[i].y = -vel_limit}
            if(velocities[i].z>vel_limit){velocities[i].z = vel_limit};
            if(velocities[i].z<-vel_limit){velocities[i].z = -vel_limit}

            wingRotations[i] += wingSpeeds[i];
            if(wingRotations[i]>wingMax){
                wingRotations[i]=wingMax;
                wingSpeeds[i] = -wingSpeeds[i];
            }
            if(wingRotations[i]<wingMin){
                wingRotations[i]=wingMin;
                wingSpeeds[i] = -wingSpeeds[i];
            }


            leftMatrix.position.set( (positions[i].x*positionMultiplier) , positions[i].y*positionMultiplier, positions[i].z*positionMultiplier );
            leftMatrix.rotation.z = wingRotations[i];

            

            let direction = Math.atan(velocities[i].x/velocities[i].z);

            leftMatrix.rotation.y =direction;
            leftMatrix.updateMatrix();

            rightMatrix.position.set( (positions[i].x*positionMultiplier) , positions[i].y*positionMultiplier, positions[i].z*positionMultiplier );
            rightMatrix.rotation.z = -wingRotations[i];
            rightMatrix.rotation.y = leftMatrix.rotation.y;
            rightMatrix.scale.x = -leftMatrix.scale.x;

            rightMatrix.updateMatrix();

            wingMesh.setMatrixAt( i*2, leftMatrix.matrix );
            wingMesh.setMatrixAt(  (i*2)+1, rightMatrix.matrix );
        }

        wingMesh.instanceMatrix.needsUpdate = true;

    }

    renderer.render(scene, camera);
    //stats.update();
}

function onWindowResize(event) {
        camera.aspect = window.innerWidth / window.innerHeight;
        camera.fov = (360 / Math.PI) * Math.atan(tanFOV * (window.innerHeight / windowHeight));
        camera.updateProjectionMatrix();
        camera.lookAt(scene.position);
        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.render(scene, camera);
}

